import React from 'react';

const HomeListingCard = (props) => {
  
  const listings = props.data
  console.log(listings);

      {listings.map((listing, key) => {
        return (
          <li>
            <div key={key}>{listing}</div>
          </li>
        )
      })}

  return (null)
};

export default HomeListingCard;
